description:
The final Nintendo DS Cave Story was canceled due to negotiations with Nintendo for the WiiWare version.  However this demo was released and shows most of the levels.  There isn't any guns or HP bar or anything.  You can basically just walk around and explore and have the monsters chase after you.

This was made by ravenworks. &lt;a href=&quot;
http://ravenworks.livejournal.com/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://ravenworks.livejournal.com/&lt;/a&gt;

Original download and info: &lt;a href=&quot;
http://community.livejournal.com/doukutsu/92406.html&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://community.livejournal.com/doukutsu/92406.html&lt;/a&gt;

Other info regarding it and gift pack to author &lt;a href=&quot;
http://nintendo.joystiq.com/2008/05/13/the-dirt-on-cave-story-ds-cave-story-engraved-ds/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://nintendo.joystiq.com/2008/05/13/the-dirt-on-cave-story-ds-cave-story-engraved-ds/&lt;/a&gt;

You will need an R4 or M3 or some other NDS rom cart to play with this.

It's too bad the author didn't finish it.  It doesn't look like it would take that much more time to complete.

